const Header = (prop) => {
  return (
    <>
      <h1>
        {prop.course}
      </h1>
    </>
  )
}

const Content = (prop) => {
  return (
    <>
      <p>
        {prop.part[0]} {prop.exercises[0]}
      </p>
      <p>
        {prop.part[1]} {prop.exercises[1]}
      </p>
      <p>
        {prop.part[2]} {prop.exercises[2]}
      </p>
    </>
  )
}


const App = () => {
  const course = 'Half Stack application development'
  const part1 = 'Fundamentals of React'
  const exercises1 = 10
  const part2 = 'Using props to pass data'
  const exercises2 = 7
  const part3 = 'State of a component'
  const exercises3 = 14

  return (
    <div>
      <h1>{course}</h1>
      <p>
        {part1} {exercises1}
      </p>
      <p>
        {part2} {exercises2}
      </p>
      <p>
        {part3} {exercises3}
      </p>
      <p>Number of exercises {exercises1 + exercises2 + exercises3}</p>
    </div>
  )
}

export default App
